using Memory.Structs;using UnityEngine;namespace Core.Management{    public static partial class Main    {        public static void SetMemoryResult(MemoryGameResult result)        {            Database.SetDatabaseString(key: DatabaseKeys.LastGameResultDatabaseKey, value: JsonUtility.ToJson(obj: result));            Database.SetDatabaseString(key: DatabaseKeys.LastGameTypeDatabaseKey, value: GameType.MEMORY.ToString());            if (result.PercentComplete == 1) SetGameTypeProgress(type: GameType.MEMORY, value: result.Level + 1);        }    }}